import Foo from './Foo.vue'

describe('Foo', () => {
  it('adicionando mock global do $route', () => {
    const $route = { path: 'http://www.meusite.com.br' }
    const wrapper = mount(Foo, {
      mocks: {
        $route
      }
    })
    expect(wrapper.vm.$route.path).toBe($route.path)
  })
})

